import React from 'react'
import { withStyles } from "@material-ui/styles"

const styles = {
  h1: {
    margin: "0px",
    color: "white",
    paddingRight:"24%"
  },
  p1: {
    padding: "16px 0px",
    color: "white",
    fontSize:"16px",
    opacity:"0.6"
  },
  section: {
    display: "flex",
    alignItems: "center",
  }
}

function Footer(props) {
  const { classes } = props;
  return (
    <div>
      {/* Section 1 */}
      <div className={classes.section}>
        <h1 className={classes.h1}>About</h1>
        <footer>
          <p className={classes.p1}>
            Put all of the information here
          </p>
        </footer>
      </div>

      {/* Section 2:Social Media */}
      <div className={classes.section}>
        <h1 className={classes.h1}>Social</h1>
        <div>
          <p className={classes.p1}>social medias</p>

        </div>
      </div>
    </div>
  )
}

export default withStyles(styles)(Footer);
